import React from 'react';
import Head from "next/head";
import AppLayout from "../components/AppLayout";

const Profile = () =>{
    const followingList = [{nickname : '제로초'},{nickname : '코드웨스트'},{nickname : '노드버드'}];
    const followerList = [{nickname : '제로초'},{nickname : '코드웨스트'},{nickname : '노드버드'}];

    return (
        <>
            <Head>
                <title>내 프로필 | NodeBird</title>
            </Head>
            <AppLayout>
                <NicknameEditForm/>
                <FollowingList header="팔로잉 목록" data={followingList}/>
                <FollowerList header="팔로워 목록" data={followerList}/>
            </AppLayout>
        </>
    );
};

export default Profile;
